  ID: string;
  NOME: string;
  CRM: number;
  TELFIXO: number;
  TELCELULAR: number;
  BAIRRO: string;
  UF: string;
  LOCALIDADE: string;
}

interface ISpecialties{
  id:string,
  name:string,

}


const listSpecialties = [
"Alergologia",
"Angiologia",
"Buco maxilo",
"Cardiologia clínca",
"Cardiologia infantil",
"Cirurgia cabeça e pescoço",
"Cirurgia cardíaca",
"Cirurgia de tórax",
]








